import React from 'react';

export default function SignUp() {
  return (
    <div class="flex flex-col items-center min-h-screen justify-center">
      <div class="bg-[#253133] bg-opacity-30 rounded-lg m-8 p-8 w-[1200px] h-[800px] flex">
        <div class="flex flex-col items-center justify-center ">
          <div class="text-center mb-8">
            <h2 class="text-[32px] font-bold  text-center mb-4 text-white">ĐĂNG KÝ</h2>
            <div class="border-t-[10px] border-[#FFFFFF] rounded-full w-[255px] mx-auto"></div>
          </div>
        </div>

      </div>
    </div>
  );
}
